Wings of the Luftwaffe: Fighter Attack

War Documentary hosted by Ron David, published by Discovery Channel broadcasted as part of DC Wings series in 1994 - English narration


Information
------------------------------

Formed in 1935, the German Luftwaffe secretly began designing formidable military aircraft while other countries leisurely explored aviation. the Luftwaffe launched many of the greatest combat aircraft of the era. The Fw 190 was a deadly success. The Me 109 became the German's reliable workhorse. The Me 262 was the only truly successful jet fighter bomber. With these planes, German Aces gave the Allies an awesome challenge in the skies.
FW 190 &quot;Butcherbird&quot; - Armed with great speed, climbing ability and agility, it penetrated Allied bomber formations, and forced them to higher altitudes. Many who flew the Fw 190 call it the war's best fighter. Messerschmitt Me 109 &quot;Legend&quot; - The Bf 109, later known as Me 109, is credited for more than half of the German kills in WWII. This successful plane became the backbone of the Luftwaffe. Me 262 &quot;Swallow&quot; - The development of the Me 262 was plagued with controversy and setbacks, but in combat the jet's performance was unequalled. With speeds of almost 550 mph, the Me 262 flew lethal missions over Europe in 1944 and 1945.

